const Profile = () => {
  return (
    <div>
      <h1>Profile</h1>
      <div>

        <div className="profile-pic">
          <img src={moss} alt="the moss"></img>
        </div>
        <ul>
          <li>Name:</li>
          <li>User Name:</li>
          <li>Email Address:</li>
          <li></li>
          <li></li>
        </ul>
      </div>
    </div>
  );
};

export default Profile;
